interface ItemProps {
    name: string;
    team?: number;
    email: any;
}

const Item = (props: ItemProps) => (
    <aside className="Item" >
        <p>'Name: {props.name}', 'Teams:{props.team}'</p>
        <p>'Email: {props.email}'</p>
    </aside>
)

